(4, 'About Us', '<p>Agoda is one of the world argest online hotel and accommodation booking platforms. Founded in 2005 and now part of Booking Holdings, Agoda offers travelers a fast, easy way to book hundreds of thousands of properties in almost every country on earth.</p>\r\n\r\n<p>In every department from engineering to customer experienc agoda provides an environment rich with creativity, collaboration, and experimentation, and the tools to work faster and smarter than almost anyone out there.</p>', 1, '2018-08-22 : 12:08:27'),
