(9, 'Terms & Cancellation', '<p><strong>Terms and Cancellation Policy</strong></p>\r\n\r\n<p><strong>PLEASE READ THE TERMS AND CONDITIONS CAREFULLY AS YOU WILL BE BOUND BY THEM BY MAKING A BOOKING ON THIS WEBSITE OR STAYING AT ANY REST & GO SDN BHD YOU AGREE TO BE BOUND BY THE FOLLOWING TERMS AND CONDITIONS. PLEASE READ THEM CAREFULLY BEFORE YOU PROCEED WITH YOUR BOOKING.</strong></p>\r\n\r\n<p><strong>General</strong></p>\r\n\r\n<p>Your contract is with <a href=\"http://www.anytimecheckin.com\">www.anytimecheckin.com</a> [product of Rest & Go SdnBhd(managing company) ] and its franchisees, associates, subsidiaries and affiliates.</p>\r\n\r\n<p>The general terms and conditions herein together with the Fee Schedule and Hotel Schedule (together these Terms and Conditions) and the Booking Confirmation constitute your contract with Rest & Go SdnBhdand are further supplemented by the internal rules and regulations that apply specifically to the Rest & Go SdnBhdwhere you have booked your stay.</p>\r\n\r\n<div>\r\n<hr></div>\r\n\r\n<p><strong>Bookings</strong></p>\r\n\r\n<p>Booking may be made online at www.anytimecheckin.com, through our call centers or at any of our Rest & Go SdnBhdvendors.</p>\r\n\r\n<p>10% payment must be made at the time of booking. We accept payment by Visa or MasterCard credit/debit cards, PayPal or online bank transfers for our Hotels. The available payment options are displayed during the booking process. For walk-in bookings, we also accept cash payments.</p>\r\n\r\n<p>Once your booking has been successfully completed, a Booking Confirmation will be issued in respect of each room booked and sent to the email address provided in your registered account. You MUST produce your booking Confirmation(s) upon check-in at the Hotel, together with your original valid photo identification document (NRIC, Passport, drivers license or other identification card or document). If you do not receive your Booking Confirmation(s) within 24 hours from the time of booking, please contact our Call Centre.</p>\r\n\r\n<p>Credit card bookings made within 5 days prior to check-in date will require presentation of the said card during check-in. Failure to do so may delay your check-in process.</p>\r\n\r\n<p>The Guest named in the Booking Confirmation must be the person staying at The Hotel otherwise we reserve the right to cancel the booking and forfeit the booking payment.</p>\r\n\r\n<p>You may check your Booking Confirmation(s) through our reply (Email Address:<strong>reservation@anytimecheckin.com</strong>).</p>\r\n\r\n<p>At all times during the booking process, you will be advised to ensure accuracy of your booking details (stay dates, room types, room rates, number of guest(s), Add-Ons). Rest & Go SdnBhdwill not be responsible or liable for errors in bookings.</p>\r\n\r\n<p>Bookings are accepted subject to room availability.</p>\r\n\r\n<div>\r\n<hr></div>\r\n\r\n<p><strong>Room Rates</strong></p>\r\n\r\n<ol>\r\n <li>Room rates shown on the Rest & Go SdnBhdwebsite are charged on a per room per night basis. Meals not included.</li>\r\n <li>Room rates are inclusive of service tax and service charge.</li>\r\n <li>Room rates and details are correct at the time of publication and are subject to change without notice.</li>\r\n</ol>\r\n\r\n<div>\r\n<hr></div>\r\n\r\n<p><strong>Rest & Go SdnBhdRooms</strong></p>\r\n\r\n<p>Rest & Go SdnBhdroom types are as follows and may vary among our Hotels:</p>\r\n\r\n<ol>\r\n <li>Double Room: 1 Queen-size bed. Maximum occupancy is 2 adults + 1 child (below 4 years old on the date of booking)</li>\r\n <li>Single Room: 2 Single beds. Maximum occupancy is 2 adults.</li>\r\n <li>Family Room 3: 1 Queen Bed + 1 Single bed. Maximum occupancy is 3 adults.</li>\r\n <li>Family Room 4: 2 Queen Beds. Maximum occupancy is 4 adults.</li>\r\n <li>Family Room 5: 2 Queen Beds + 1 Single bed. Maximum occupancy is 5 adults.</li>\r\n <li>Family Room 6: 3 Queen Bed. Maximum occupancy is 6 adults.</li>\r\n</ol>\r\n\r\n<p>Rest & Go SdnBhdhas a strict NO SMOKING policy. Failure to comply will entitle us to terminate your booking and must leave the Hotel immediately.</p>\r\n\r\n<div>\r\n<hr></div>\r\n\r\n<p><strong>Restrictions</strong></p>\r\n\r\n<p>You may not bring the following into Hotels:</p>\r\n\r\n<ol>\r\n <li>Pets (except for registered guide dogs) or livestock</li>\r\n <li>Pillows, bed sheets, duvets or other items of bedding</li>\r\n <li>Any electrical appliances and/or equipment for heating and/or cooking purposes</li>\r\n</ol>\r\n\r\n<p>Rest & Go SdnBhdreserves the right to remove and/or confiscate any of the above items found in any room immediately without notice to you and to charge you for any costs incurred for taking such action.</p>\r\n\r\n<p>Rest & Go SdnBhdfurther reserves the right to ask you to leave the Hotel and remove your belongings from the room immediately is we shall, in our sole opinion, deem that you have used the room in an irresponsible manner or in a manner that will compromise the safety of, or cause damage and/or harm to the room, the Hotel premises, the other Hotel guests, staff or any other persons or the reputation to Rest & Go SdnBhdwithout any compensation and/or any reimbursement to you.</p>\r\n\r\n<div>\r\n<hr></div>\r\n\r\n<p><strong>Check-in and Check-out</strong></p>\r\n\r\n<p>All Rest & Go SdnBhdoperate a strict check-in and check-out policy, the times of which vary from hotel to hotel.</p>\r\n\r\n<p><strong>Check-in</strong></p>\r\n\r\n<p>Booked rooms will be held for check-in until 2.00 pm the following day of the scheduled check-in date, after which the booking will be deemed cancelled and Rest & Go SdnBhdshall be entitled to release the booked room(s) for the remaining stay dates to other guests. No refunds will be provided for the cancelled booking.</p>\r\n\r\n<p>A refundable keycard deposit it may be required upon check-in to the hotels to cover loss or damage of the keycard issued.<strong>(Please refer to https://www.anytimecheckin.com/info/check-in-check-out/)</strong>.</p>\r\n\r\n<div>\r\n<hr></div>\r\n\r\n<p><strong>Check-out</strong></p>\r\n\r\n<p>If you check-out beyond the stipulated time Rest & Go SdnBhdreserves the right, without further notice to you, to charge you an additional one (1) nights stay at the then prevailing room rate or remove your belongings into the luggage storage facility and deny you further access into the room. Rest & Go SdnBhdshall not be liable for any loss or damage to your belongings as a result of the action(s) taken.</p>\r\n\r\n<div>\r\n<hr></div>\r\n\r\n<p><strong>Changes and Cancellations</strong><br>\r\nBooking made are non-refundable.</p>\r\n\r\n<p><strong>Changes</strong></p>\r\n\r\n<p>Changes of Guest name on your booking are allowed if made 3 days or more before check-in date subject to a Name Change Fee.<strong>(Please refer to https://www.anytimecheckin.com/info/check-in-check-out/).</strong></p>\r\n\r\n<p>No changes regarding stay dates, room category, duration of stay may be made but you are entitled to cancel the booking and make a new booking with Hotel, subject to availability, and to the terms of cancellation below.</p>\r\n\r\n<div>\r\n<hr></div>\r\n\r\n<p><strong>Cancellations</strong></p>\r\n\r\n<p>Booking cancellations MUST be made at least 3 days before<strong> </strong>the scheduled check-in date. A cancellation fee applies for each Booking Confirmation cancelled.<strong>(Please refer to https://www.anytimecheckin.com/info/check-in-check-out/).</strong></p>\r\n\r\n<p>The value of your booking minus the cancellation fee will be retained in a Credit Shell for your future booking(s) with Rest & Go SdnBhdsubject to the terms of use of Credit Shell and provided that the booking value is more than the cancellation fee.</p>\r\n\r\n<p>Any cancellation made less than 3 days from the scheduled check-in date will result in the total payment under that Booking Confirmation being forfeited irrespective of the number of stay dates remaining.</p>\r\n\r\n<p>Change of Guest name and cancellation of booking can only be made at our email address: reservation@anytimecheckin.com or by making a call to Restngosdn bhd.</p>\r\n\r\n<p>Unless otherwise expressly stated, no changes or cancellation will be allowed for promotional bookings. Please read the terms and conditions of the relevant promotion carefully.</p>\r\n\r\n<div>\r\n<hr></div>\r\n\r\n<p><strong>Use of Credit Shell</strong></p>\r\n\r\n<p>Your Credit Shell will be created in the currency which your booking transaction was made and must be used in that same currency for payment of future booking with Restngosdnbhds.</p>\r\n\r\n<p>Your Credit Shell is valid for a period of 6 months from the date of cancellation of your booking. If you fail to use it within the validity period the amount in your Credit Shell will be absolutely forfeited, not transferable to other persons or accounts, not exchangeable for cash and cannot be used for payment of non-room related transactions.</p>\r\n\r\n<div>\r\n<hr></div>\r\n\r\n<p><strong>Optional Facilities</strong></p>\r\n\r\n<p><strong>Luggage Storage</strong></p>\r\n\r\n<p>Luggage storage is available only for Guests currently staying with the Hotel to store their luggage or other personal belongings before check-in or check-out.</p>\r\n\r\n<p>You may purchase this through the Front Desk at a minimal charge.<strong>(Please refer to https://www.anytimecheckin.com/info/check-in-check-out/).</strong>Each luggage will be tagged with a luggage identification tag and may only be retrieved by the bearer of the tag. If the tag cannot be produced during collection, we may nevertheless allow the luggage to be collected if the person claiming it can establish, to our satisfaction, his/her or authority to collect the luggage otherwise the Hotel reserves the right to dispose of the same without any liability to you.</p>\r\n\r\n<p>Each luggage must weigh no more than 30kgs. The maximum storage period is 1 day. The Hotel reserves the right to dispose of any luggage or items not claimed after the maximum storage period allowed.</p>\r\n\r\n<p>You use the luggage storage facilities at your own risk. Rest & Go SdnBhdwill not be responsible for loss of or damage to luggage or personal belongings and the contents therein (including any valuables, even if we have been advised) during storage or during the disposal process however caused and you release Rest & Go SdnBhdfrom any liability in respect thereof.</p>\r\n\r\n<div>\r\n<hr></div>\r\n\r\n<p><strong>Damage</strong></p>\r\n\r\n<p>You are liable for any damage howsoever caused to the allocated room(s) or to the Hotel property by you or any persons in your party (whether or not staying at the Hotel) during your stay. Rest & Go SdnBhdreserves the right to retain your credit card and/or debit card details and charge or debit such amounts as it shall in its sole discretion deem fit on the said card(s) to compensate or make good the loss, damage, costs or expenses incurred or suffered as a result thereof. Rest & Go SdnBhdfurther reserves the right to commence legal proceeding against you without notice.</p>\r\n\r\n<div>\r\n<hr></div>\r\n\r\n<p><strong>Right to Refuse Accommodation</strong></p>\r\n\r\n<p>Rest & Go SdnBhdreserves the right to refuse accommodation to any person(s) without any notice and terminate any booking without being liable for any refund or compensation for the following reasons:-</p>\r\n\r\n<ul>\r\n <li>The booking has been paid through fraudulent means.</li>\r\n <li>The booking has been altered by anyone other than Rest & Go SdnBhdor Restngosdnbhds authorized agent has been tampered with or defaced (in which case Rest & Go SdnBhdreserves the right to retain such booking documentation)</li>\r\n <li>The person checking in is not or cannot prove that he/she is the person named in the Booking Confirmation as permitted under the provisions of these Terms and Conditions.</li>\r\n</ul>\r\n\r\n<div>\r\n<hr></div>\r\n\r\n<p><strong>Limitation of liability</strong></p>\r\n\r\n<p>Rest & Go SdnBhdis responsible to provide the room(s) according to these Terms and Conditions. We do not accept any liability for failure to provide the service contracted or any of them due to circumstances beyond our control.</p>\r\n\r\n<p>Restng</p>\r\n\r\n<p>osdnbhds is not in a position to guarantee Guests safety against events including but not limited to accidents, death, acts of God, flood, riot, theft or even acts of negligence. All activities have inherent risks to health and safety and Rest & Go SdnBhdwill not be responsible for any eventualities related to any activities or services booked through this website.</p>\r\n\r\n<p>Rest & Go SdnBhdwill not responsible for loss or damage of property left in Guests room and/or the Rest & Go SdnBhdproperty during Guests stay. Guests are advised to obtain insurance to cover curtailment, and loss of luggage, personal effects, damages, personal injuries and money/valuable belongings.</p>\r\n\r\n<div>\r\n<hr></div>\r\n\r\n<p><strong>Privacy and Data Protection</strong></p>\r\n\r\n<p>Rest & Go SdnBhdwill retain all personal information you provide during booking. By making a booking with us or using the Rest & Go SdnBhdwebsite, you consent to our use and/or disclosure of your personal details to our branches, to enable or assist us in the provision of services or to exercise or enforce our rights hereunder and/or any other party as Rest & Go SdnBhdmay, in our sole and absolute discretion, deem necessary for the following purposes:</p>\r\n\r\n<ol>\r\n <li>To process your booking and for other administrative purposes.</li>\r\n <li>To provide you customer support and services.</li>\r\n <li>To send you information on products and services, and special or promotional offers, newsletters or customer survey forms and questionnaires.</li>\r\n</ol>\r\n\r\n<p>You may unsubscribe from these at any time by clicking on the unsubscribe link on the relevant email communications.</p>\r\n\r\n<p>We may also be legally obliged to disclose, and you irrevocably consent to our disclosing, your personal information to government and enforcement agencies, regulatory bodies and public authorities or as may be required by law. This may involve sending your personal information between different countries.</p>\r\n\r\n<p>We will use our best endeavors to use your personal information in the manner stated herein and will not otherwise disclose your personal information without your prior written consent.</p>\r\n\r\n<div>\r\n<hr></div>\r\n\r\n<p><strong>Copyright and Trade marks</strong></p>\r\n\r\n<p>The Rest & Go SdnBhdwebsite including the booking and other applications, text, graphics, designs, audio and video clips, hotel and destination information and all other content thereon are the property of Rest & Go SdnBhdand/or its content suppliers.</p>\r\n\r\n<p>You may use this website and its content solely for personal, non-commercial and private use subject always to applicable copyright laws.</p>\r\n\r\n<p>All trademarks, trade names, services marks and all other marks, whether registered or unregistered, on the Rest & Go SdnBhdwebsite are owned by or licensed to Rest & Go SdnBhdand their respective owners and may not be used, reproduced or modified without the prior written approval of Restngosdnbhds.</p>\r\n\r\n<div>\r\n<hr></div>\r\n\r\n<p><strong>Disclaimer</strong></p>\r\n\r\n<p>The Rest & Go SdnBhdwebsite, the services provided and all content thereon are supplied as is and as available. Rest & Go SdnBhdprovides no guarantee regarding the website and content. You are solely responsible for your use thereof.</p>\r\n\r\n<p>While we will make every effort to ensure that the information on the Rest & Go SdnBhdwebsite is accurate and published in good faith, we do not warrant or represent its accuracy and disclaims to the maximum extent permitted by law all warranties expressed or implied by statute, custom or usage.</p>\r\n\r\n<p>Rest & Go SdnBhdwill not be liable for any direct, indirect, consequential, punitive losses or damage (including without limitation loss of revenue, loss of goodwill, loss of reputation and loss of, or damage to data), arising out of this website or the use thereof, or any errors, inaccuracies or omissions in the services or content provided howsoever caused.</p>\r\n\r\n<p>The various linked sites on our Rest & Go SdnBhdsite allows for further link-up and interaction between Guests and the said sites for promotions and other interactive mediums. The inclusion of all website links on our Rest & Go SdnBhdwebsite does not imply endorsement by Rest & Go SdnBhdof such linked sites, or any association with their operations. These sites are outside the control of Restngosdnbhds. We will not be responsible for the content on the linked sites or your use thereof.</p>\r\n\r\n<div>\r\n<hr></div>\r\n\r\n<p><strong>Governing Laws</strong></p>\r\n\r\n<p>Your contract with Rest & Go SdnBhdis governed by the laws of the country where the Rest & Go SdnBhdyou booked your stay with is located and any dispute shall be settled in the courts of that country.</p>\r\n\r\n<p>All other matters concerning or relating to the Rest & Go SdnBhdwebsite shall be governed by the Laws of Malaysia and the Malaysian courts shall have jurisdiction therein.</p>\r\n\r\n<div>\r\n<hr></div>\r\n\r\n<p><strong>Changes to the these Terms and Conditions</strong></p>\r\n\r\n<p>Rest & Go SdnBhdreserves the right to cancel, amend or vary the arrangements and content featured on the Rest & Go SdnBhdwebsite and/or change or add to these Terms and Conditions at anytime without prior notice.</p>\r\n\r\n<div>\r\n<hr></div>\r\n\r\n<p><strong>Conflict between English Text and other Language Text</strong></p>\r\n\r\n<p>If there is any conflict or discrepancy between the English text of these Terms and Conditions and any transaction thereof, the English text shall prevail.</p>', 1, '2019-07-10 : 07:07:08');
