(74, 43, 'SINGLE', 20, NULL, '130', 1000, 1, 1, 1, '2019-03-09 12:03:10', '2019-03-09 12:03:10', 0, '', 'The Alps need little introduction; soaring peaks, huddles of chalets and unmissable vistas. For travellers with pets, taking your furry friend with you might inspire dreams of gallivanting through the snow, panoramic walks cresting mountain peaks and curling up by the fireplace afterwards. No need to dream any longer – these Alpine lodges have got you and your pet covered.');
